import Vue from 'vue'
import VueRouter from 'vue-router';
import RecipePage from '../containers/RecipePage';

Vue.use(VueRouter);

const router = new Vuerouter({
    routes: [{
        path:'/',
        name:'recipes',
        component: RecipePage
    }]
});

export default router;
